import React from 'react';
import styled from 'styled-components/native';

const SC = {
    Container: styled.View`
        flex: 0.5;
        flex-Direction: row;
        justify-Content: space-between;
        align-Items: center;
        padding: 0 20px;
        border-Bottom-Width: 1px;
        border-Bottom-Color: #d3d3d3;
    `,
    left: styled.View`
        flex-direction: row;
    `,
    reviewText: styled.Text`
        font-family: Light;
        color : gray;
    `,
    reviewNums: styled.Text`
    `,
    right: styled.View`
    `,
}

const ReviewOptionBar = (props) => {
    return (
        <View style={styles.optionBar}>
            <View style={styles.reviewsSummaryWrap}>
                <Text style={styles.reviewText}>리뷰</Text>
                <Text style={styles.reviewNumber}>{props.reviewNums}개</Text>
            </View>
            <View style={styles.reviewViewOption}>

            </View>
        </View>
    )
}

export default ReviewOptionBar;
